        return (
            <div>
              <center>
                <div style={{width: '75%'}}>
                  <ImageGallery items={avciso_imgaes} showPlayButton={false} showThumbnails={false}/>
                </div>
              </center>
              <div style={{margin: '10px'}}></div>
              <center>
                <div style={{width: '75%'}}>
                  <ImageGallery items={public_ballot_images} showPlayButton={false} showThumbnails={false}/>
                </div>
              </center>
          </div>
        )
    }
}

export default Main;
